import {
  InlineA,
  Manifesto,
  Caption,
  Label,
} from "../components/Typography/index";
import styled from "styled-components";
import React from "react";

export default () => {
  return <Wrapper></Wrapper>;
};

const SticyNavStyle = {
  display: "flex",
  justifyContent: "space-between",
  position: "fixed" as "fixed",
  padding: "60 60 0",
};

function StickyNav(props) {
  const { name, role } = props;
  return (
    <nav style={SticyNavStyle}>
      <div>
        <Label color="#111" align="left">
          {name}
        </Label>
        <Label>{role}</Label>
      </div>
    </nav>
  );
}

export const Wrapper = styled.main`
  position: fixed;
  left: 0;
  right: 0;
  bottom: 0;
  top: 0;
  background-color: #fafafa;
`;
